$(".status-success").click(function(){var b=$(this).data("id");var a=HOSTNAMEADMIN+"/customize/status_success";if(confirm("Xác nhận đặt lịch?")){$.ajax({method:"get",url:a,data:{id:b},success:function(c){if(c.status==200){$(".row-status-"+b).fadeOut()}},error:function(d,c){}})}});$(".status-cancel").click(function(){var b=$(this).data("id");var a=HOSTNAMEADMIN+"/customize/status_cancel";if(confirm("Hủy đặt lịch?")){$.ajax({method:"get",url:a,data:{id:b},success:function(c){if(c.status==200){$(".row-status-"+b).fadeOut()}},error:function(d,c){}})}});